    return(
        <div id="bio" className="">
            <h2 className="offset-1">About Me</h2>
            <div className="row justify-content-center">
                <p className="col-10 ltrsp-sm">{lorem}</p>             
            </div>
        </div>
    )
}//end method

export default Bio;
